import React from "react";
import BaseLayout from "../components/layouts/BaseLayout";

class Blogs extends React.Component {
  render() {
    return (
      <BaseLayout>
        <h1>I am Blogs Page</h1>
      </BaseLayout>
    );
  }
}

export default Blogs;
